import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from "react-router-dom";
import Home from "./Home/Home.js";
import Projects from "./Projects/Projects.js";
import Music from "./Music/Music.js";
import Art from "./Art/Art.js";
import * as Env from "./../environments.js";

const Components = () => {
  /*let natURL = `${Env.BASE_URL}/nat`;
  let projectsURL = `${Env.BASE_URL}/projects`;
  let musicURL = `${Env.BASE_URL}/music`;
  let artURL = `${Env.BASE_URL}/art`;*/
  return (
    <Router>
      <Routes>
        <Route path={Env.NAT_URL} element={<Home />} />
        <Route path={Env.PROJECTS_URL} element={<Projects />} />
        <Route path={Env.MUSIC_URL} element={<Music />} />
        <Route path={Env.ART_URL} element={<Art />} />
        <Route path="*" element={<Navigate to={Env.NAT_URL} replace />} />
      </Routes>
    </Router>
  );
};


